import React from 'react';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPrint } from "@fortawesome/free-solid-svg-icons";
import moment from 'moment';

const PrintAssetsPDF = ({ assets }) => {
  const handlePrint = () => {
    window.print();
  };

  return (
    <>
      <button
        onClick={handlePrint}
        className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded flex items-center print:hidden"
      >
        <FontAwesomeIcon icon={faPrint} className="mr-2" />
        Print Asset Inventory
      </button>

      <div className="hidden print:block">
        <h1 className="text-3xl font-bold mb-6 text-center">Asset Inventory</h1>
        {assets.map((asset) => (
          <div key={asset.asset_id} className="mb-8 pb-4 border-b">
            <h2 className="text-2xl font-semibold mb-2">{asset.assetName}</h2>
            <div className="grid grid-cols-2 gap-4">
              <div>
                <p><strong>ID:</strong> {asset.asset_id}</p>
                <p><strong>Date Created:</strong> {moment(asset.createdDate).format('MM/DD/YYYY')}</p>
                <p><strong>Category:</strong> {asset.category}</p>
                <p><strong>Location:</strong> {asset.location}</p>
                <p><strong>Quantity:</strong> {asset.quantity}</p>
                <p><strong>Allocated Quantity:</strong> {asset.allocatedQuantity || 0}</p>
              </div>
              <div>
                <p><strong>Cost:</strong> ₱{asset.cost}</p>
                <p><strong>Type:</strong> {asset.type}</p>
                <p><strong>Status:</strong> {asset.is_active ? 'Active' : 'Inactive'}</p>
                <p><strong>Supplier:</strong> {asset.supplier}</p>
                <p><strong>Serial Number:</strong> {asset.serialNumber}</p>
                <p><strong>Warranty Expiration:</strong> {asset.warrantyExpiration ? moment(asset.warrantyExpiration).format('MM/DD/YYYY') : 'N/A'}</p>
              </div>
            </div>
            <p className="mt-2"><strong>Details:</strong> {asset.assetDetails}</p>
            {asset.image && (
              <img src={asset.image} alt={asset.assetName} className="mt-4 max-w-xs mx-auto" />
            )}
          </div>
        ))}
      </div>
    </>
  );
};

export default PrintAssetsPDF;
